import React from 'react';

class App extends React.Component {
  state = {
    posts: [
      { titulo: 'Titulo post 1', resumo: 'Resumo post 1' },
      { titulo: 'Titulo post 2', resumo: 'Resumo post 2' },
      { titulo: 'Titulo post 3', resumo: 'Resumo post 3' },
      { titulo: 'Titulo post 4', resumo: 'Resumo post 4' },
      { titulo: 'Titulo post 5', resumo: 'Resumo post 5' },
      { titulo: 'Titulo post 6', resumo: 'Resumo post 6' },
    ],
  };

  handleClick = () => {};

  render() {
    return (
      <div>
        {this.state.posts.map((item) => (
          <div>
            <h5>{item.titulo}</h5>
            <p>{item.resumo}</p>
            <button onClick={handleClick}>Excluir</button>
            <hr></hr>
          </div>
        ))}
      </div>
    );
  }
}

export default App;
